#include <iostream>
#include <vector>

using namespace std;

class Solution {
public:
	int findMaxLength(vector<int>& nums) {
		int n = nums.size();
		if (n<=1) return 0;
		vector<int> sums(n,0);
		sums[0] = nums[0];
		for (int i = 1; i < n; ++i) sums[i] = sums[i-1]+nums[i];
		int mostOnes = sums[n-1];
		int mostZeros = n - mostOnes;
		int mostLen = min(mostOnes, mostZeros)*2;
		for (int i = mostLen; i >= 0; --i)
		{
			for (int j = 0; j+i < n; ++j)
			{
				int ones = sums[j+i]-sums[j]+nums[j];
				int zeros = i+1-ones;
				if (ones == zeros) 
				{
					return i+1;
				}
			}
		}
		return 0;
	}
};

